
jQuery(document).ready(function(b){
	var a=true;
	b("#main-menu-toggle").click(function(){
		if(b(this).hasClass("open")){
			b(this).removeClass("open").addClass("closeleft");
			var f=b("#content").attr("class");
			var e=parseInt(f.replace(/^\D+/g,""));
			var c=e+2;
			var d="span"+c;
			b("#content").addClass("full");
			b("#sidebar-left").hide()}
		else{
			b(this).removeClass("closeleft").addClass("open");
			var f=b("#content").attr("class");
			var e=parseInt(f.replace(/^\D+/g,""));
			var c=e-2;
			d="span"+c;
			b("#content").removeClass("full");
			b("#sidebar-left").show()}})});

